padding:2%;
background-color: teal;
height: 85vh;
display: flex;

@media screen and (max-width:1207px)
{
   padding-top:35px;
display:block;

}
button{
margin:2%;
height:50px;
width:100px;

}


`
const Line = styled.div`
flex-direction: column;
flex-basis:50% ;
display:flex;
justify-content:center;
align-items: center;

`
const Imagee = styled.div`
flex-basis:50% ;
text-align: center;
img{
width:80%;
height:90%;


}
`
const Headline = styled.div`
@media screen and (min-width:1207px){
width:100%;
}

`


